import { NavLink } from "react-router-dom";

function Header() {
    return (
        <header className="header">
            <a href="#" className="header__logo"></a>
            <nav className="header__nav">
                <NavLink to={"/sing-in"} className={"header__link"}>Регистрация</NavLink>
            </nav>
        </header>
    );
} 

export default Header
